import logo from './logo.svg';
import './App.css';
import {
  BrowserRouter as Router,
  Routes,
  Route,
} from "react-router-dom";
import { CreateNft } from './pages/createNft.js';
import { ConnectWeb3 } from './pages/connectWeb3';
import { HomePage } from './pages/rootPage';

function App() {
  return (
    <div className="App">
      <header>
        <Router>
          <section className="">
            <Routes>
              <Route exact path='/' element={<HomePage />}/>
              <Route exact path='/connection' element={<ConnectWeb3 />}/>
              <Route exact path='/filetohash' element={<CreateNft />}/>
            </Routes>
          </section>
        </Router>
      </header>
    </div>
  );
}

export default App;
